def decryptfordis1(v):
   cmd=struct.unpack(">L",v[:4])[0]
   v=v[4:]
   a,b=0,0
   v=[m for m in v]
   KEY = "QIDAIN_SZWZ_9999"
   while b<len(v):
      if (b+3)<=(len(v)-1):
         a=v[b+2]
         v[b+2]=chr(255-ord(v[b+3]))
         v[b+3]=a
         b=b+5
         continue
      break
   v="".join(v)
   c=v[:(len(KEY))]
   if c!=KEY:
      return None
   return (cmd,v[(len(KEY)):])
def encryptfordis(cmd,v):
   pref=struct.pack(">L",cmd)
   a,b=0,0
   KEY = "QIDAIN_SZWZ_9999"
   v=KEY+v
   v=[m for m in v]
   while b<len(v):
      if (b+3)<=(len(v)-1):
         a=chr(255-ord(v[b+2]))
         v[b+2]=v[b+3]
         v[b+3]=a
         b=b+5
         continue
      break
   v="".join(v)
   return (pref+v)
def readGDWmessage(x):
	if len(x)<4:
		return None,x
	size=struct.unpack(">L",x[:4])[0]
	if len(x)<(size+4):
		return None,x
	msg=x[4:(size+4)]
	cmd,msg=decryptfordis1(msg)
	cmdname=IDLIST1[str(cmd)]
	obj=globals()[cmdname]()
	obj.ParseFromString(msg)
	return (obj,x[(size+4):])
